IF OBJECT_ID('dbo.proc_transform_313', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_313;
GO
CREATE PROCEDURE dbo.proc_transform_313
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_313
    SET payload = LEFT(payload, 1000) + N'|V4-313|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_313;
END
